import { useState } from "react"

import "./form.css"

function Form(){
    const [val,setval]=useState(" ")
    const [email,emailsetval]=useState("")
    const [password,passwordsetval]=useState("")
    const handleSubmit = (e) =>{
        e.preventdefault();
    }
    return(
        <>
        <form onSubmit={handleSubmit}>

            <label>Enter your name:
            <input type='text' value={val} onChange={(e)=> setval (e.target.val)} /> 
            </label>

            
            <label>Enter your Email:
            <input type='email' value={email} onChange={(e)=> emailsetval (e.target.val)} /> 
            </label>

            
            <label>Enter your password:
            <input type='password' value={password} onChange={(e)=> passwordsetval (e.target.val)} /> 
            </label>

            <button type="sumit">Submit </button>

        </form>
        </>
    )
}

export default Form;
